import React from 'react'
import logo from '../src/images/Vector-Smart-Object11.png'
import './header.css'
import {Link} from 'react-router-dom'



function header() {
 
  function get(){
     document.getElementById("home")
    if ("home") {
      document.getElementById("home").style.webkitTextFillColor="white"
    } else {
      document.getElementById("home").style.webkitTextFillColor="blue"
    }
   
  
  } 

  return (
    <div className='navbar'>

     <div className='logo'>
     <img src={logo} className='image-logo' alt=''></img>
     </div>
     <div className='nav-text'>
      
        <Link className='link-header' to ='/'>        <p onClick={get} id='home' className='navtexts'>HOME</p></Link>
        <Link className='link-header'  to='/aboutus'> <p onClick={get} id='=abt' className='navtexts'>ABOUT</p></Link>
        <Link className='link-header' to ='/services'><p className='navtexts'>SERVICES</p></Link>
        <Link className='link-header' to='/contactus'><p className='navtexts'>CONTACT US</p></Link>
        
        
        </div>
  
       
       </div>
  
   
  

  )
}

export default header
